import { Link } from "react-router-dom";

export default function Plants(props) {
  const { plants } = props;
  return (
    <div>
      <h3>Plants</h3>
      {plants.map((plant) => (
        <React.Fragment key={plant.id}>
          <Link to={`/plants/${plant.id}`}>
            <p>{plant.name}</p>
          </Link>
          {currentUser?.id} === plant.user_id && (
          <>
            <Link to={`/plants/${plant.id}/edit`} />
            <button>Edit a</button>
          </>
          )
        </React.Fragment>
      ))}
    </div>
  );
}
